import React from 'react';
import * as ReactDOMClient from 'react-dom/client';
import './style.css'

const pagetitle = "Регистрация"
const textlogin = "Логин"
const textpassword = "Пароль"
const area = document.getElementById("inputs")

//Paste IMG
const imgarea = document.getElementById("logo")
const Img = <img src={require('./images/logo.jpeg')} alt = "Logo" id = "logoImg"></img>
const rootimg = ReactDOMClient.createRoot(imgarea)
rootimg.render(Img)

//Paste Title
//const Title = <h1>{pagetitle}</h1>
const titlearea = document.getElementById("pagetitle")
const roottitle = ReactDOMClient.createRoot(titlearea)
roottitle.render(<h1>{pagetitle}</h1>)


//Paste Login form
const loginclick = () => {
    let login = document.getElementById("InLogin").value;
    let pass = document.getElementById("InPassword").value;
    console.log(login, pass);
}

class LoginItems extends React.Component{
    render(){
        return(
            <div className = "group">
                <h1>{textlogin}</h1>
                <input id = "InLogin" placeholder = {"Введите имя пользоателя"}></input>
                <h1>{textpassword}</h1>
                <input id = "InPassword" placeholder = {"Введите пароль"}></input>
                <button id ="LoginButton" onClick={loginclick}>Войти</button>
            </div>
        )
    }
}

const root = ReactDOMClient.createRoot(area)
root.render(<LoginItems />)
